        public static int LengthOfLongestSubstring(String s)
        {
            /* Frustrated attempt to see if 70%-tile is actually best for Optimized Sliding Window 
             * Port of the Java Sliding Window Optimized
             * 
             * CONCLUSION: I hate leetcode. This thing ran 4ms faster than WhileLoopNoRemove.
             */

            int largest = 0;

            Dictionary<Char, int> substr = new Dictionary<char, int>();

            for (int i = 0, j = 0; j < s.Length; j++)
            {
                if (substr.ContainsKey(s[j]))
                {
                    i = (substr[s[j]] > i) ? substr[s[j]] : i;
                }
                largest = (largest > j - i + 1) ? largest : j - i + 1;

                if (substr.ContainsKey(s[j]))
                {
                    substr[s[j]] = j + 1;
                }
                else
                {
                    substr.Add(s[j], j + 1);
                }

            }


            return largest;
        }
        public static int LengthOfLongestSubstring_WhileLoopNoRemove(String s)
        {

            /* Attempt at the while loop implementation without any removals. 
             * Writing over/update will be used instead
             *
             */
            int largest = 0;
            int beg = 0;
            int end = 0;

            Dictionary<Char, int> substr = new Dictionary<char, int>();

            Console.WriteLine("_____________________________________________________");
            Console.WriteLine("String: " + s);
            while (s.Length > end && (s.Length - beg) > largest)
            {
                //build substr
                while (s.Length > end && (!substr.ContainsKey(s[end]) || substr[s[end]] < beg ))
                {
                    Console.WriteLine("build substr START:" + beg + "|" + s[beg] + "||END: " + end + " | " + s[end]);
                    if (substr.ContainsKey(s[end]))
                    {
                        substr[s[end]] = end ;
                    }
                    else
                    {
                        substr.Add(s[end], end);
                    }
                    
                    end++;
                    //Console.WriteLine("build substr END:" + beg + "|" + s[beg] + "||END: " + end + " | " + s[end]);
                }


                Console.WriteLine("String Index: " + beg + "|" + end);
                //check to see if it's longest
                if ((end-beg +1) > largest)
                {
                    Console.WriteLine("largest:" + largest + "|" + substr.Count);
                    largest = (end - beg);
                }

                //clear out anything up to duplicate item
                if (s.Length <= end) break;
                beg = substr[s[end]] + 1;

                Console.WriteLine("String Index: " + beg + "|" + end);

                // safety
                if (end > 1000) { Console.WriteLine("idiot"); break; }
            }
            Console.WriteLine("_____________________________________________________");

            return largest;
        }
        public static int LengthOfLongestSubstring_WhileLoop(String s)
        {

            /* 1) Implementation with while loop to make it easier to track location in string
             * 2) Success!!!
             *      Runtime: 84 ms, faster than 81.57% of C# online submissions for Longest Substring Without Repeating Characters.
             *      Memory Usage: 25.5 MB, less than 8.70% of C# online submissions for Longest Substring Without Repeating Characters.
             * 3) Need to try minimizing the remove portion to speed up algo.
             */
            int largest = 0;
            int beg = 0;
            int end = 0;
            
            Dictionary<Char, int> substr = new Dictionary<char, int>();

            Console.WriteLine("_____________________________________________________");
            Console.WriteLine("String: " + s);
            while (s.Length > end )
            {
                //build substr
                while (s.Length > end && !substr.ContainsKey(s[end]) )
                {
                    Console.WriteLine("build substr START:"+ beg + "|" + s[beg] + "||END: " + end + " | " + s[end]);
                    substr.Add(s[end],end);
                    end++;
                    //Console.WriteLine("build substr END:" + beg + "|" + s[beg] + "||END: " + end + " | " + s[end]);
                }

                
                Console.WriteLine("String Index: " + beg + "|" + end);
                //check to see if it's longest
                if (substr.Count > largest)
                {
                    Console.WriteLine("largest:" + largest + "|" + substr.Count);
                    largest = substr.Count;
                }
                    

                //clear out anything up to duplicate item
                while (s.Length > end &&( substr.ContainsKey(s[end]) && (beg <= end)))
                {
                    Console.WriteLine("reduce substr START:" + beg + "|" + s[beg]);
                    substr.Remove(s[beg]);
                    beg++;
                    Console.WriteLine("reduce substr END:" + beg + "|" + s[beg]);
                }

                Console.WriteLine("String Index: " + beg + "|" + end);

                // safety
                if (end > 1000) { Console.WriteLine("idiot"); break; }
            }
            Console.WriteLine("_____________________________________________________");

            return largest;
        }
        public static int LengthOfLongestSubstring_ForLoop(String s)
        {
            /* Notes:
             * This style fails on the super long test where they repeat all available characters.
             * Could be salvaged but may need a stack or something to avoid rebuilding the hash table.
             * Also found for loop structure to be very confusing.
             */
            int largest = 0;
            int j;
            Dictionary<Char, int> substr = new Dictionary<char, int>();
            int dup1;
            int dup2;
            Console.WriteLine("START String:" + s);
            for (int i = 0; (i < s.Length) && (s.Length - i > largest); i++)
            {
                for (j = i; (j < s.Length) && !substr.ContainsKey(s[j]); j++)
                {
                    substr.Add(s[j], j);
                    Console.WriteLine("Index:" + j + "|letter:" + s[j]);
                }

                if (j < s.Length)
                {
                    dup2 = j;
                    Console.WriteLine("dup2:" + dup2);
                    dup1 = substr[s[dup2]];
                    Console.WriteLine("dup1:" + dup1);
                    i = dup1;
                }

                if (substr.Count > largest)
                {
                    largest = substr.Count;
                }

                Console.Write("substring:");
                foreach (Char c in substr.Keys)
                    Console.Write(c);
                Console.WriteLine();
                substr.Clear();
            }
            return largest;
        }





    }
